(481, 315, 252, 'Se realizaron pruebas de impresión con el usuario Ernesto', '2020-07-15 21:32:00', '2020-07-15 21:32:00'),
(482, 316, 252, 'El usuario tenía problemas de recepción de correo ya que losmxlientes mencionaron que al enviarle un correo este era rebotado mandando un mensaje de buzón lleno', '2020-07-16 17:16:00', '2020-07-16 17:16:00'),
(483, 316, 252, 'Por lo que entramos a cpanel d tralo y aumentamos el.almacenamiento de la cuneta del usario Rubén ', '2020-07-16 17:22:00', '2020-07-16 17:22:00'),
(484, 316, 252, 'Efectivamente tenía problemas con buzón lleno ', '2020-07-16 17:22:00', '2020-07-16 17:22:00'),
(485, 317, 252, 'La señora Rebeca tiene problemas con visualizar imágenes descargadas de su correo electrónico ', '2020-07-16 17:52:00', '2020-07-16 17:52:00'),
(486, 317, 252, 'Se realizó asistencia en remoto para poder ayudar a solucionar el problema ', '2020-07-16 17:52:00', '2020-07-16 17:52:00');
INSERT INTO `service_follows` (`id`, `service_id`, `author_id`, `body`, `created_at`, `updated_at`) VALUES
(487, 317, 252, 'Verificamos si era posible abrir otro archivo imagen ', '2020-07-16 17:55:00', '2020-07-16 17:55:00'),
(488, 317, 252, 'Y encontramos que el formato de las imágenes que i tentaba abrir tenía otro formato por lo que simplemente se tenía que elegir con que aplicación abrir', '2020-07-16 17:56:00', '2020-07-16 17:56:00'),
(489, 318, 252, 'El.uario tiene problema para trabajar en la aplicación de Outlook, ya que al abrir la aplicación se cierra al instante, para ello trabajaremos vía remota con el equipo del ususario Lina Marin ', '2020-07-16 21:27:00', '2020-07-16 21:27:00'),
(490, 318, 252, 'Actividades realozada', '2020-07-16 21:28:00', '2020-07-16 21:28:00'),
(491, 318, 252, '1.- se abrí la aplicación en modo a pruebas de errores. 2.- posteriormente se realizó la reparación de ella.paqueteria de office, después de esto no logramos tener solución al mismo.', '2020-07-16 21:29:00', '2020-07-16 21:29:00'),
(492, 318, 252, '3.- en seguida continuamos desinstalando la aplicacion de office, entramos a la cuenta corporativa del usario en la.plataforma de 365, descargamos paquetería de office y posteriormente instalamos.', '2020-07-16 21:30:00', '2020-07-16 21:30:00'),
(493, 318, 252, 'Después de instalar la paquetería de office abrimos Outlook, configuramos cuenta de correo electronico, abrimos la aplicación esperando que el problema haya sido resuelto.', '2020-07-16 21:31:00', '2020-07-16 21:31:00'),
(494, 318, 252, 'Al realizar la última configuración mencionada en la actividad 3, corregimos el problema de la aplicación.', '2020-07-16 21:32:00', '2020-07-16 21:32:00'),
(495, 319, 252, 'El usuario menciona que no puede entrar a la aplicación de team, entramos a revisar y trabajar por medio de modo remoto al equipo para brindar el soporte necesario', '2020-07-16 22:09:00', '2020-07-16 22:09:00'),
(496, 319, 252, 'Primeramente realizamos.pruebas y nos.percqtamos que la cuneta ya estaba dada de alta por lo que era un problema de cuentas administrativas. Se realizó elmlevantamiento de un ticket en la.platafoema de Microsoft 365 para la.ayuda.de la cuenta', '2020-07-16 22:11:00', '2020-07-16 22:11:00'),
(497, 319, 252, 'Recibimos.lladama de Microsoft y verificamos la cuenta de Microsoft que estaba vinculada la cuenta empresarial con una cuneta pesonal y esto causa el conflicto', '2020-07-16 22:16:00', '2020-07-16 22:16:00'),
(498, 319, 252, 'Desinstalamos la aplicación de teams, entramos a la.cuneta 365 del usuario y descargamos nuevamente la aplicación ingresamos a la cuneta y seleccionamos.la.opcion de cuneta empresarial ', '2020-07-16 22:17:00', '2020-07-16 22:17:00'),
(499, 319, 252, 'El problema fue resuelto solo falta tener una segunda sesión con Microsoft para arreglar y dejar de vincular las cuentas', '2020-07-16 22:18:00', '2020-07-16 22:18:00'),
(500, 320, 252, 'Se realizó el remate de dos.ndos en el.call center', '2020-07-17 22:52:00', '2020-07-17 22:52:00'),
(501, 322, 252, 'Se instaló y configuro AP para Wayak enlace operativo', '2020-07-21 17:25:00', '2020-07-21 17:25:00'),
(502, 322, 252, 'Para que puedan trabajar los usuarios por medio de wifi', '2020-07-21 17:26:00', '2020-07-21 17:26:00'),
