(506, 311, 256, 'El equipo funciona correctamente, aún sigue la falla en la cámara web ', '2020-07-26 03:36:00', '2020-07-26 03:36:00'),
(507, 311, 256, 'La ventana que aparecía se solucionó sacando un disco en la unidad de disco ', '2020-07-26 03:37:00', '2020-07-26 03:37:00'),
(508, 311, 256, 'Una recomendación es poner una webcam externa', '2020-07-26 03:38:00', '2020-07-26 03:38:00'),
