(40, 33, 123, 7, 'Normal', 'Trabajo', 'MIGRACION CCA DE MTY A EDOMEX', 'Hola buen día\r\n\r\nSolicito de su apoyo para una cotización para una migración de infraestructura que se tiene que hacer de Monterrey, NL a Huixquilucan, Estado de México.\r\n\r\nSeria desconectar los equipos en Monterrey y traerlos para que se entreguen, la conexión está a cargo de ellos\r\n\r\nLa desconexión se realizaría el sábado 4 de Julio y la entrega debe ser el Domingo 5 de Julio en el Estado de México\r\n\r\nEquipos a trasladar.\r\n\r\nEquipo Marca Modelo No. de serie Peso Dimensiones\r\nPort Gigabit Ethernet ForcePoint RJ45 Module A0B6638039 1 kg\r\nPort Gigabit Ethernet ForcePoint RJ45 Module A0B6638037 1 kg\r\nFirewall VPN ForcePoint StoneGate 325 N0B8627012 2.2 kg 305 x 44 x 196mm 12 x 1.73 x 7.72in\r\nFirewall Extranet ForcePoint ForcePoint StoneGate 1035 N0B0627041 4.2 kg 426 x 44 x 300mm 16.77 x 1.73 x 11.81in\r\nFirewall Internet ForcePoint ForcePoint StoneGate 1035 N0B0627046 4.2 kg 426 x 44 x 300mm 16.77 x 1.73 x 11.81in\r\n\r\n\r\nEstas son las direcciones\r\n\r\n- Nueva Dirección : Vía Magna 25, Manzana 3 Lote 19, Despacho A1, Col. Bosques de la Herradura, C.P. 52783, Huixquilucan, Estado de México\r\n\r\n- Dirección actual: MTY (Av. Miguel Alemán No. 770, Kalos, 66603, CD Apodaca, N.L.)\r\n\r\nQuedo atento por cualquier duda o comentario\r\nSaludos', '2020-07-03', '80%', 'Privado', 'NO', '2020-11-26 07:16:10', '2020-11-26 07:16:10'),
