(43, 33, 123, 7, 'Normal', 'Trabajo', 'PORTON AUTOMATICO NUEVO LAREDO', 'Hola René\r\n\r\nConforme a la llamada que tuvimos hoy, te anexo más información sobre el requerimiento de nuestro cliente. Por favor considerar proyecto llave en mano debe incluir:\r\n• Propuesta de portón (corredizo/abatible, etc)\r\n• Mecanismo de operación eléctrico, con opción a operación manual de manera simple.\r\n• Obra civil necesaria para montaje de puertas.\r\n• Sistema solar para operación continua dimensionado para 24 o 48 hrs, se estiman 10 ciclos (apertura/cierre) diarias por puerta.\r\n• Poste con cimentación, gabinete para baterías y elementos de control\r\n• Control remoto (incluir 12 controles, al menos 2 por puerta) e interfaz ethernet para conectividad a centro de control.\r\n• FO con canalizaciones y registros según estimación para conectar a FO troncal.\r\n• Todo lo necesario para asegurar la conectividad a centro de control. (latiguillos, conversor Ethernet FO.\r\n\r\nPor favor cualquier duda adicional puedes contactarme.\r\nQuedo atento\r\nMuchas gracias\r\n\r\n\r\nRivelino Álvarez González\r\nTRANSPORTE', '2020-07-10', '60%', 'Privado', 'NO', '2020-11-26 07:19:23', '2020-11-26 07:19:23'),
