(53, 33, 123, 7, 'Normal', 'Trabajo', 'COTIZACION INSUMOS COVID', 'Estimado proveedor buena tarde\r\nSolicito de su valioso apoyo para cotizar el siguiente material.\r\nPor el momento no podemos confirmar un numero de volumetría en los productos, se nos ocurre manejarlo de esta manera, con base en estos tres puntos fundamentales\r\n\r\n Costos por volumetría de compra (ej. 1-500 unidades precio 20 USD, 501-1000unidades precio 15 USD).\r\n Tiempos de entrega.\r\n Calidad o certificaciones de los productos.\r\n\r\nAquí el listado de lo solicitado\r\n\r\n• Cubre bocas KN95 en marca 3M o marcas similares que tengan el mismo desempeño.\r\n• Cubrebocas plisado triple capa termosellado, con ajustador de nariz. (con recubrimiento antiviral y antimicrobial)\r\n• Gel antibacterial (Alcohol al 70%) en presentación de 1 lt con dispensador.\r\n• Gel antibacterial (Alcohol al 70%) en presentación de 1 galón.\r\n• Dispensador automático de jabón antibacterial.\r\n• Dispensador automático o semiautomático de pedestal para alcohol gel.\r\n• Termómetros infrarrojos digital para toma de temperatura corporal (modelo de referencia HT-668)\r\n• Cámara termográfica infrarroja (modelo de referencia UTI165H)\r\n• Bactericida en presentación de 1lt o en presentación de galón, para limpieza de superficies (pisos- manijas, puertas, escritorios, sillas de tela etc.) de preferencia que esté autorizado y/o registrado por la EPA (Agencia de Protección ambiental )para la eliminación del SARS-Cov2\r\n• Tapetes sanitizantes tipo charola para evitar derrames y con alfombrilla de secado\r\n• Rollo de cinta reflejante adherible bicolor (amarillo/negro) de 5cm de ancho. (superficies donde se colocara pisos vinílicos, mármol y alfombra o moqueta)\r\n• Flechas adheribles para señalización sentidos de circulación en color azul y rojo (superficies donde se colocara pisos vinílicos, mármol y alfombra o moqueta)\r\n• Lentes googles de seguridad Material Policarbonato Color Transparente\r\n• Caretas Material PVC en 2mm/cal 20\r\n• Señalizaciones / carteles de prevención ante el covid:\r\n uso obligatorio de alcohol gel\r\n Mantener sana distancia\r\n Respetar el sentido de flujo o circulación\r\n Toma de temperatura\r\n Lavarse las manos frecuentemente\r\n Utilizar cubrebocas\r\n Aforo máximo permitido en comedor\r\n Uso obligatorio de tapete sanitizante\r\n Asiento inhabilitado temporalmente\r\nFabricados en material PVC de 21 x 29 cm', '2020-07-15', '80%', 'Privado', 'NO', '2020-11-26 07:28:56', '2020-11-26 07:28:56'),
(54, 33, 123, 7, 'Normal', 'Trabajo', 'MRO Sureste / RFP Solución solar', 'Estimados, buen día.\r\n\r\nUn gusto en saludarlos, esperando se encuentren bien.\r\n\r\nComo algunos saben, estamos participando en el paquete de MRO sureste, y como en la mayoría de los proyectos, hay que instalar equipamiento con solución solar\r\n\r\n• Hay valoradas 2 alternativas:\r\no Opción 1: cada dispositivo ITS lleva su propio armario y su alimentación solar\r\no Opción 2: Ingeniería ha hecho una propuesta para que algunos equipos compartan ubicación, por lo que compartirían el armario y la alimentación eléctrica.\r\n• Los PMV y las estaciones meteorológicas ya llevan incluida la alimentación solar por parte del proveedor (Lacroix y Dilus). No obstante, si pueden cotizarlo así vemos que resulta más económico.\r\n• En la opción 2 hay que cotizar 99 alimentación solar de 100W y 9 de 150W.\r\n• Nos garanticen que se dispone de suficiente espacio en el armario para incluir nuestros equipos (Switch, fuente y caja de F.O).\r\n\r\nAdjunto encontraran el RFP para Solución solar, para que por favor me ayuden con sus propuestas.\r\n\r\nAgradecemos su apoyo.\r\nSaludos.', '2020-07-15', '0%', 'Privado', 'NO', '2020-11-26 07:30:04', '2020-11-26 07:30:04'),
(55, 33, 123, 7, 'Normal', 'Trabajo', 'CAMARAS PINFRA', 'Estimado proveedor buena tarde\r\n\r\nPor favor su apoyo con una cotización de las siguientes cámaras, favor de contemplar soporte para poste, y si es necesario, el lente y carcasa.\r\n\r\n- 1 ud – cámara PTZ marca Dahua modelo DH-SD6AL245UN-HNI\r\n- 1 ud – cámara PTZ marca PNS modelo PNS-625SL-X33P\r\n- 1 ud – cámara Fija marca PNS modelo PNS PRO 4052-P\r\n\r\nSi los modelos están descatalogados favor de ofrecer algo con características similares a estas: (En este caso, favor de solicitar las fichas técnicas)\r\n- Cámara Domo PTZ IP Láser IR (con soporteria), zoom 33x, láser varifocal de 30m a 500m, Wide Dynamic Range 120dB, Protección IP66, 2Mpixeles\r\n- Cámara Fija o DAI (con soporteria), 2Mpixeles, zoom 12x, Full HD\r\n\r\nHabría que cotizar esto también:\r\n- Switch RAISECOM Gazelle capa 2, S1010i-GL, 4 x ptos FE, 2 x ptos Fibra\r\nDe antemano le agradezco y quedo atento a sus comentarios.', '2020-07-21', '80%', 'Privado', 'NO', '2020-11-26 07:31:14', '2020-11-26 07:31:14'),
